import React, { Component } from 'react';
import UserInfo from './UserInfo';
import './Builder.css';

class Builder extends Component {
  constructor(props) {
    super(props);
    this.state = {
      appMode: {
        isEdit: false,
        isViewOnly: false
      },
    };
  }
  render() {
    const appMode = this.state.appMode;
    return (
      <main>
        <UserInfo
          appMode={appMode}
        />
      </main>
    );
  }
}

export default Builder;
